/**
 * Returns a file for you to write.
 *
 * @more If a write is already happening, throws. In other words, you must provide your own
 *     locking.
 *     <p>Call {@link #commit} to commit the changes, or {@link #rollback} to forget the changes.
 */
public File chooseForWrite() {
  if (mWriting) {
    throw new IllegalStateException("uncommitted write already in progress");
  }
  if (!mReal.exists()) {
    // If the real one doesn't exist, it's either because this is the first time
    // or because something went wrong while copying them. In this case, we can't
    // trust anything that's in temp. In order to have the chooseForRead code not
    // use the temporary one until it's fully written, create an empty file
    // for real, which will we'll shortly delete.
    try {
      mReal.createNewFile();
    } catch (IOException e) {
      // Ignore
    }
  }

  if (mTemp.exists()) {
    mTemp.delete();
  }
  mWriting = true;
  return mTemp;
}

private void copyDataBase(String at) throws IOException {
  long start = System.currentTimeMillis();
  try {
    installMeter.onBeforeCopy();
  } catch (Exception e) {
    Log.e(getClass().getSimpleName(), "onBeforeCopy Exception", e);
  }
  List<String> partions = new ArrayList<String>();
  final String[] files = assets.list("database");
  for (String f : files) {
    if (f.startsWith("database.sqlite_")) {
      partions.add(f);
    }
  }
  Collections.sort(partions);
  long totalSize = partions.size() * 51200;

  try {
    installMeter.onSizeToBeCopiedCalculated(totalSize);
  } catch (Exception e) {
    Log.e(getClass().getSimpleName(), "onSizeToBeCopiedCalculated Exception", e);
  }
  OutputStream out = null;
  try {
    File file = ctx.getDatabasePath(at);
    File parent = file.getParentFile();
    if (parent != null) {
      parent.mkdirs();
    }
    if (!file.exists()) {
      file.createNewFile();
    }
    out = new FileOutputStream(file);
    byte[] buffer = new byte[1024];
    long totalBytesCopied = 0;
    for (String partition : partions) {
      final InputStream in = assets.open("database/" + partition);
      int read;
      while ((read = in.read(buffer)) > 0) {
        out.write(buffer);
        totalBytesCopied += read;
      }
      in.close();
      try {
        float percent = totalBytesCopied / (float) totalSize;
        percent = Math.min(1, percent);
        installMeter.onPercentCopied(totalSize, percent, totalBytesCopied);
      } catch (Exception e) {
        Log.e(getClass().getSimpleName(), "onPercentCopied Exception", e);
      }
    }
    Root.deleteScheduleDates(ctx);
    Root.saveDatabaseVersion(ctx, Root.getVersion(ctx));
  } catch (Exception e) {
    throw new RuntimeException(e);
  } finally {
    if (out != null) {
      out.flush();
      out.close();
    }
  }
  long end = System.currentTimeMillis();
  Root.saveCopyDatabaseDuration(ctx, end - start);
  try {
    installMeter.onFinishedCopying();
  } catch (Exception e) {
    Log.e(getClass().getSimpleName(), "onFinishedCopying exception", e);
  }
  Log.d(
      getClass().getSimpleName(),
      "copyDatabase(...) took " + Root.getCopyDatabaseDuration(ctx) + "ms");
}

public void writeFileAttachment() {
  if (this.attachment != null) {
    FileOutputStream fop = null;
    File file;
    String content = this.attachment.getAttachmentContent();

    try {

      file = new File(this.attachment.getAttachmentName());

      fop = new FileOutputStream(file);

      // if file doesnt exists, then create it
      if (!file.exists()) {
        file.createNewFile();
      }

      // get the content in bytes
      byte[] contentInBytes = content.getBytes();

      fop.write(contentInBytes);
      fop.flush();
      fop.close();

    } catch (IOException e) {
      e.printStackTrace();
    } finally {
      try {
        if (fop != null) {
          fop.close();
        }
      } catch (IOException e) {
        e.printStackTrace();
      }
    }
  }
}

/**
 * Get a file for random binary access. If the file doesn't exist, it will be created.
 *
 * <p>Calls to write() will not flush automatically. Call file.getChannel().force(true) to force
 * writes to flush to disk.
 *
 * @param fileRef the file to open
 * @return an opened RandomAccessFile wrapping the requested file
 * @throws IOException an error occurred opening or creating the file
 */
public static RandomAccessFile getOrCreateFile(File fileRef) throws IOException {
  if (!fileRef.exists()) {
    fileRef.getParentFile().mkdirs();
    fileRef.createNewFile();
  }

  RandomAccessFile file;
  try {
    file = new RandomAccessFile(fileRef, "rw");
  } catch (FileNotFoundException e) {
    // This should never happen.
    throw new IllegalStateException("Java said the file exists, but it can't open it", e);
  }

  return file;
}

