/**
 * Helper to create a large file of random data on the SD card.
 *
 * @param filename (optional) The name of the file to create on the SD card; pass in null to use a
 *     default temp filename.
 * @param type The type of file to create
 * @param subdirectory If not null, the subdirectory under the SD card where the file should go
 * @return The File that was created
 * @throws IOException if there was an error while creating the file.
 */
protected File createFileOnSD(String filename, long fileSize, DataType type, String subdirectory)
    throws IOException {

  // Build up the file path and name
  String sdPath = Environment.getExternalStorageDirectory().getPath();
  StringBuilder fullPath = new StringBuilder(sdPath);
  if (subdirectory != null) {
    fullPath.append(File.separatorChar).append(subdirectory);
  }

  File file = null;
  if (filename == null) {
    file = File.createTempFile("DMTEST_", null, new File(fullPath.toString()));
  } else {
    fullPath.append(File.separatorChar).append(filename);
    file = new File(fullPath.toString());
    file.createNewFile();
  }

  // Fill the file with random data
  DataOutputStream output = new DataOutputStream(new FileOutputStream(file));
  final int CHUNK_SIZE = 1000000; // copy random data in 1000000-char chunks
  long remaining = fileSize;
  int nextChunkSize = CHUNK_SIZE;
  byte[] randomData = null;
  Random rng = new LoggingRng();
  byte[] chunkSizeData = generateData(nextChunkSize, type, rng);

  try {
    while (remaining > 0) {
      if (remaining < CHUNK_SIZE) {
        nextChunkSize = (int) remaining;
        remaining = 0;
        randomData = generateData(nextChunkSize, type, rng);
      } else {
        remaining -= CHUNK_SIZE;
        randomData = chunkSizeData;
      }
      output.write(randomData);
      Log.i(
          TAG,
          "while creating "
              + fileSize
              + " file, "
              + "remaining bytes to be written: "
              + remaining);
    }
  } catch (IOException e) {
    Log.e(LOG_TAG, "Error writing to file " + file.getAbsolutePath());
    file.delete();
    throw e;
  } finally {
    output.close();
  }
  return file;
}

public static void persistentDevice(Context context, List<Device> deviceList) {
  File file = new File(context.getFilesDir().getPath() + File.separator + Constants.DEVICELIST);
  if (file.exists()) {
    file.delete();
  }
  FileOutputStream fos = null;
  try {
    file.createNewFile();
    StringBuffer sb = new StringBuffer();
    for (Device device : deviceList) {
      String unDefine2 =
          (device.getUnDefine2() == null || device.getUnDefine2().length() <= 0)
              ? "null"
              : device.getUnDefine2();
      boolean netType = device.getDeviceNetType();
      sb.append(
          device.getDeviceName()
              + "&"
              + device.getDeviceID()
              + "&"
              + device.getUnDefine1()
              + "&"
              + netType
              + "&");
      if (netType) {
        sb.append(
            device.getUnDefine1()
                + "&"
                + device.getDeviceEthGateWay()
                + "&"
                + device.getDeviceRemoteCmdPort()
                + "&"
                + device.getDeviceRemoteVideoPort()
                + "&"
                + device.getDeviceRemoteAudioPort()
                + "&"
                + unDefine2
                + "\n");
      } else {
        sb.append(
            device.getDeviceEthIp()
                + "&"
                + device.getDeviceEthGateWay()
                + "&"
                + device.getDeviceLocalCmdPort()
                + "&"
                + device.getDeviceLocalVideoPort()
                + "&"
                + device.getDeviceLocalAudioPort()
                + "&"
                + unDefine2
                + "\n");
      }
    }
    // System.out.println(sb.toString());
    fos = new FileOutputStream(file);
    fos.write(sb.toString().getBytes());
    fos.flush();
  } catch (IOException e) {
    Log.d(TAG, "FileUtil persistentDevice " + e.getStackTrace());
  } finally {
    if (fos != null) {
      try {
        fos.close();
      } catch (IOException e) {
        e.printStackTrace();
      }
      fos = null;
    }
  }
}

