/**
 * Creates an empty temporary file in the given directory using the given prefix and suffix as
 * part of the file name.
 *
 * @param prefix the prefix to the temp file name.
 * @param suffix the suffix to the temp file name.
 * @param directory the location to which the temp file is to be written, or {@code null} for the
 *     default location for temporary files, which is taken from the "java.io.tmpdir" system
 *     property. It may be necessary to set this property to an existing, writable directory for
 *     this method to work properly.
 * @return the temporary file.
 * @throws IllegalArgumentException if the length of {@code prefix} is less than 3.
 * @throws IOException if an error occurs when writing the file.
 * @since Android 1.0
 */
public static File createTempFile(String prefix, String suffix, File directory)
    throws IOException {
  // Force a prefix null check first
  if (prefix.length() < 3) {
    throw new IllegalArgumentException(Msg.getString("K006b")); // $NON-NLS-1$
  }
  String newSuffix = suffix == null ? ".tmp" : suffix; // $NON-NLS-1$
  String tmpDir = "."; // $NON-NLS-1$
  tmpDir =
      AccessController.doPrivileged(
          new PriviAction<String>("java.io.tmpdir", ".")); // $NON-NLS-1$//$NON-NLS-2$
  File result, tmpDirFile = directory == null ? new File(tmpDir) : directory;
  do {
    result = genTempFile(prefix, newSuffix, tmpDirFile);
  } while (!result.createNewFile());
  return result;
}

public static void copyFile(File sourceFile, File destFile) throws IOException {
  if (sourceFile.equals(destFile)) return;
  if (!destFile.exists()) destFile.createNewFile();

  FileChannel source = null;
  FileChannel destination = null;
  try {
    source = new FileInputStream(sourceFile).getChannel();
    destination = new FileOutputStream(destFile).getChannel();
    destination.transferFrom(source, 0, source.size());
  } finally {
    if (source != null) {
      source.close();
    }
    if (destination != null) {
      destination.close();
    }
  }
} // end copyFile()

