    removeAddOnsConfigFile.delete();
  }
}

private static File create(File file) throws IOException {
  if (file.exists()) {
    throw new IllegalStateException(
        MessageFormat.format("File \"{0}\" already exists.", file.getAbsolutePath()));
  }
  file.createNewFile();
  file.setReadable(false, false);
  file.setWritable(true, true);
  file.setReadable(true, true);
  return file;
}

private void create() {
  try {
    Bukkit.getLogger().log(Level.INFO, "Creating file: " + file.getName());
    file.getParentFile().mkdirs();
    file.createNewFile();
  } catch (IOException ex) {
    Bukkit.getLogger().log(Level.SEVERE, "Could not create file: " + file.getName());
  }
}

/**
 * Writes information about the installed packs and the variables at installation time.
 *
 * @throws IOException
 * @throws ClassNotFoundException
 */
public void writeInstallationInformation() throws IOException, ClassNotFoundException {
  if (!idata.info.isWriteInstallationInformation()) {
    Debug.trace("skip writing installation information");
    return;
  }
  Debug.trace("writing installation information");
  String installdir = idata.getInstallPath();

  List installedpacks = new ArrayList(idata.selectedPacks);

  File installationinfo =
      new File(installdir + File.separator + AutomatedInstallData.INSTALLATION_INFORMATION);
  if (!installationinfo.exists()) {
    Debug.trace("creating info file" + installationinfo.getAbsolutePath());
    installationinfo.createNewFile();
  } else {
    Debug.trace("installation information found");
    // read in old information and update
    FileInputStream fin = new FileInputStream(installationinfo);
    ObjectInputStream oin = new ObjectInputStream(fin);

    List packs = (List) oin.readObject();
    for (Object pack1 : packs) {
      Pack pack = (Pack) pack1;
      installedpacks.add(pack);
    }
    oin.close();
    fin.close();
  }

  FileOutputStream fout = new FileOutputStream(installationinfo);
  ObjectOutputStream oout = new ObjectOutputStream(fout);
  oout.writeObject(installedpacks);
  /*
  int selectedpackscount = idata.selectedPacks.size();
  for (int i = 0; i < selectedpackscount; i++)
  {
  Pack pack = (Pack) idata.selectedPacks.get(i);
  oout.writeObject(pack);
  }
  */
  oout.writeObject(idata.variables);
  Debug.trace("done.");
  oout.close();
  fout.close();
}

/** Generate a .classpath containing a .jar in war/WEB-INF/lib. */
public void testCreatorOnlyEclipseWithJars() throws IOException, WebAppCreatorException {
  runCreator("-out", projectFolder, "-XnoEclipse", "-junit", mockJar, MY_PROJECT);

  String libDir = "war" + File.separatorChar + "WEB-INF" + File.separatorChar + "lib";
  assertTrue(new File(projectFolder + File.separatorChar + libDir).mkdirs());

  String libJarName = libDir + File.separatorChar + "foo.jar";
  File libFile = new File(projectFolder + File.separatorChar + libJarName);
  assertTrue(libFile.createNewFile());

  runCreator("-out", projectFolder, "-XonlyEclipse", "-junit", mockJar, MY_PROJECT);

  assertFileExists(".classpath");
  File classpathFile = new File(projectFolder + File.separatorChar + ".classpath");
  String classpathContents = Util.readURLAsString(classpathFile.toURI().toURL());
  String canonicalLibJarName = libJarName.replaceAll(Pattern.quote(File.separator), "/");
  assertTrue(
      ".classpath does not contain "
          + canonicalLibJarName
          + ". .classpath contents:"
          + classpathContents,
      classpathContents.contains(canonicalLibJarName));
}

